import React, { Fragment } from 'react';
import { Link } from 'react-router-dom';
import Navigation from './Navigation'
import Footer from './Footer'

const Billeterie = () => {
    return(
        <Fragment>
            <Navigation />
                <p className="billeterie">Billeterie</p>
                <div className="">
                    Billeterie en ligne
                </div>
                <table>
                    <tr></tr>
                </table>

            <Footer />
        </Fragment>

    )
}

export default Billeterie;
